actionConfiguration.body:
() => {
		return ListVerifiedKYCDocQuery.data.map((entry) => {
			const dirs = entry.fileName.split("/");
			const fileDetails = dirs[2].split("__");
			return {
				DocumentType: VerificationJSObject.docShortForms[fileDetails[0]],
				Status: fileDetails[1] === 's' ? 'Success' : 'Failure',
				VerificationFileName: fileDetails[2],
				Download: '',
				path: entry.fileName
			};
		});
	}

